import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Dashboard.css"; // Ensure CSS file is linked

const Dashboard = () => {
  const [donors, setDonors] = useState([]);
  const [name, setName] = useState("");
  const [bloodType, setBloodType] = useState("");
  const [city, setCity] = useState("");
  const [contact, setContact] = useState("");

  useEffect(() => {
    axios.get("http://localhost:5000/api/donors")
      .then((response) => setDonors(response.data))
      .catch((error) => console.error("Error fetching donors:", error));
  }, []);

  const handleDonorSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/api/donors", {
        name,
        bloodType,
        city,
        contact,
      });
      alert("‚úÖ Donor added successfully!");
      setDonors([...donors, response.data.donor]);
      setName(""); setBloodType(""); setCity(""); setContact("");
    } catch (error) {
      console.error("‚ùå Donor registration failed:", error);
    }
  };

  return (
    <div className="dashboard-container">
      <h2 className="dashboard-title">ü©∏ Blood Donor Dashboard</h2>

      {/* Horizontal Scroll Container */}
      <div className="scroll-container">
        {/* Register as Donor Section */}
        <div className="scroll-section">
          <h3>Become a Donor</h3>
          <form onSubmit={handleDonorSubmit}>
            <input type="text" placeholder="Full Name" value={name} onChange={(e) => setName(e.target.value)} required />
            <select value={bloodType} onChange={(e) => setBloodType(e.target.value)} required>
              <option value="">Select Blood Type</option>
              <option value="A+">A+</option>
              <option value="A-">A-</option>
              <option value="B+">B+</option>
              <option value="B-">B-</option>
              <option value="AB+">AB+</option>
              <option value="AB-">AB-</option>
              <option value="O+">O+</option>
              <option value="O-">O-</option>
            </select>
            <input type="text" placeholder="City" value={city} onChange={(e) => setCity(e.target.value)} required />
            <input type="text" placeholder="Contact Number" value={contact} onChange={(e) => setContact(e.target.value)} required />
            <button type="submit">Register</button>
          </form>
        </div>

        {/* Find a Donor Section */}
        <div className="scroll-section">
          <h3>Find a Donor</h3>
          <input type="text" placeholder="Enter City" />
          <select>
            <option value="">Select Blood Type</option>
            <option value="A+">A+</option>
            <option value="A-">A-</option>
            <option value="B+">B+</option>
            <option value="B-">B-</option>
            <option value="AB+">AB+</option>
            <option value="AB-">AB-</option>
            <option value="O+">O+</option>
            <option value="O-">O-</option>
          </select>
        </div>
      </div>

      {/* Navigation Buttons */}
      <div className="scroll-buttons">
        <button onClick={() => document.querySelector('.scroll-container').scrollBy({ left: -400, behavior: 'smooth' })}>‚¨ÖÔ∏è</button>
        <button onClick={() => document.querySelector('.scroll-container').scrollBy({ left: 400, behavior: 'smooth' })}>‚û°Ô∏è</button>
      </div>

      {/* Donor List */}
      <div className="donor-list">
        <h3>Available Donors</h3>
        {donors.map((donor) => (
          <div key={donor._id} className="donor-card">
            <p>üìç {donor.city} | ü©∏ {donor.bloodType} | üìû {donor.contact} | üë§ {donor.name}</p>
            <button className="donate-btn">Donate Now</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
